import React, { Component } from 'react';
import '../css/Footer.css';
import facebook from '../imgs/facebook.svg';
import instagram from '../imgs/instagram.svg';
import pint from '../imgs/pint.svg';
import vtex from '../imgs/vtex.svg';
import ebit from '../imgs/ebit.svg';

class Header extends Component {

  constructor(props) {
    super(props);

    this.state = {
      badges: 0
    };
  }

  render() {
    return (
      <div className="footer">
        <footer className="container">
          <div className="flex flex-column{">
            <div className="redes-sociais flex">
              <a href="">
                <img src={facebook} />
              </a>
              <a href="">
                <img src={instagram} />
              </a>
              <a href="">
                <img src={pint} />
              </a>
            </div>
          </div>
          <div className="flex">
            <div className="flex">
              <img src={vtex} />
              <img src={ebit} />
            </div>
            <div className="footer-menu flex flex-space-between">
              <div className="footer-menu-box">
                <div className="footer-menu-box-header">
                  <h6>Institucional</h6>
                </div>
                <div className="footer-menu-box-content">
                  <ul>
                    <li>
                      <a href="">
                        A Marca
                      </a>
                    </li>
                    <li>
                      <a href="">
                        Lojas
                      </a>
                    </li>
                    <li>
                      <a href="">
                        Contatos
                      </a>
                    </li>
                  </ul>
                </div>
              </div>
            </div>
          </div>
        </footer>
      </div>
    );
  }
}

export default Header;
